All metrics that your project collects must be defined in a metrics.yaml file. To learn more, see adding new metrics . See the metric parameters documentation which provides reference information about the contents of that file. Important : as stated before , any new data collection requires documentation and data-review. This is also required for any new metric automatically collected by the Glean SDK. In order for the Glean SDK to generate an API for your metrics, two Gradle plugins must be included in your build: The Glean Gradle plugin JetBrains' Python envs plugin The Glean Gradle plugin is distributed through Mozilla's Maven, so we need to tell your build where to look for it by adding the following to the top of your build.gradle: buildscript { repositories { // Include the next clause if you are tracking snapshots of android components maven { url "https://snapshots.maven.mozilla.org/maven2" } maven { url "https://maven.mozilla.org/maven2" } dependencies { classpath "org.mozilla.components:tooling-glean-gradle:{android-components-version}" } }
} Important: as above, the {android-components-version} placeholder in the above link should be replaced with the version number of android components used in your project. The JetBrains Python plugin is distributed in the Gradle plugin repository, so it can be included with: plugins { id "com.jetbrains.python.envs" version "0.0.26"
} Right before the end of the same file, we need to apply the Glean Gradle plugin. Set any additional parameters to control the behavior of the Glean Gradle plugin before calling apply plugin. // Optionally, set any parameters to send to the plugin.
ext.gleanGenerateMarkdownDocs = true
apply plugin: "org.mozilla.telemetry.glean-gradle-plugin" Note: Earlier versions of Glean used a Gradle script (sdk_generator.gradle) rather than a Gradle plugin. Its use is deprecated and projects should be updated to use the Gradle plugin as described above. Note: The Glean Gradle plugin has limited support for offline builds of applications that use the Glean SDK. The metrics.yaml file is parsed at build time and Swift code is generated. Add a new metrics.yaml file to your Xcode project. Follow these steps to automatically run the parser at build time: Download the sdk_generator.sh script from the Glean repository: https://raw.githubusercontent.com/mozilla/glean/{latest-release}/glean-core/ios/sdk_generator.sh Important: as above, the {latest-version} placeholder should be replaced with the version number of Glean SDK release used in this project. Add the sdk_generator.sh file to your Xcode project. On your application targets' Build Phases settings tab, click the + icon and choose New Run Script Phase. Create a Run Script in which you specify your shell (ex: /bin/sh), add the following contents to the script area below the shell: bash $PWD/sdk_generator.sh Note: If you are using the combined release of application-services and the Glean SDK you need to set the namespace to MozillaAppServices, e.g.: bash $PWD/sdk_generator.sh --glean-namespace MozillaAppServices Add the path to your metrics.yaml and (optionally) pings.yaml under "Input files": $(SRCROOT)/{project-name}/metrics.yaml
$(SRCROOT)/{project-name}/pings.yaml Add the path to the generated code file to the "Output Files": $(SRCROOT)/{project-name}/Generated/Metrics.swift Important : The parser now generates a single file called Metrics.swift (since Glean v31.0.0). If you are using Git, add the following lines to your .gitignore file: .venv/
{project-name}/Generated This will ignore files that are generated at build time by the sdk_generator.sh script. They don't need to be kept in version control, as they can be re-generated from your metrics.yaml and pings.yaml files. Important information about Glean and embedded extensions: Metric collection is a no-op in application extensions and Glean will not run. Since extensions run in a separate sandbox and process from the application, Glean would run in an extension as if it were a completely separate application with different client ids and storage. This complicates things because Glean doesn’t know or care about other processes. Because of this, Glean is purposefully prevented from running in an application extension and if metrics need to be collected from extensions, it's up to the integrating application to pass the information to the base application to record in Glean. For Python, the metrics.yaml file must be available and loaded at runtime. If your project is a script (i.e. just Python files in a directory), you can load the metrics.yaml using: from glean import load_metrics metrics = load_metrics("metrics.yaml") # Use a metric on the returned object
metrics.your_category.your_metric.set("value") If your project is a distributable Python package, you need to include the metrics.yaml file using one of the myriad ways to include data in a Python package and then use pkg_resources.resource_filename() to get the filename at runtime. from glean import load_metrics
from pkg_resources import resource_filename metrics = load_metrics(resource_filename(__name__, "metrics.yaml")) # Use a metric on the returned object
metrics.your_category.your_metric.set("value")

