The following steps are required for applications using the Glean SDK, but not libraries. Note : The initialize function must be called, even if telemetry upload is disabled. Glean needs to perform maintenance tasks even when telemetry is disabled, and because Glean does this as part of its initialization, it is required to always call the initialize function. Otherwise, Glean won't be able to clean up collected data, disable queuing of pre-init tasks, or perform other required operations. This does not apply to special builds where telemetry is disabled at build time. In that case, it is acceptable to not call initialize at all. Note : The Glean SDK does not support use across multiple processes, and must only be initialized on the application's main process. Initializing in other processes is a no-op. Additionally, Glean must be initialized on the main (UI) thread of the applications main process. Failure to do so will throw an IllegalThreadStateException. An excellent place to initialize Glean is within the onCreate method of the class that extends Android's Application class. import org.mozilla.yourApplication.GleanMetrics.GleanBuildInfo
