} Once initialized, if uploadEnabled is true, the Glean SDK will automatically start collecting baseline metrics and sending its pings , according to their respective schedules. If uploadEnabled is false, any persisted metrics, events and pings (other than first_run_date and first_run_hour) are cleared, and subsequent calls to record metrics will be no-ops. The Glean SDK should be initialized as soon as possible, and importantly, before any other libraries in the application start using Glean. Library code should never call Glean.initialize, since it should be called exactly once per application. Note : if the application has the concept of release channels and knows which channel it is on at run-time, then it can provide the Glean SDK with this information by setting it as part of the Configuration object parameter of the Glean.initialize method. For example: Glean.initialize( applicationContext, uploadEnabled = setting().isTelemetryEnabled, configuration = Configuration(channel = "beta"), buildInfo = GleanBuildInfo.buildInfo
) Note : When the Glean SDK is consumed through Android Components, it is required to configure an HTTP client to be used for upload. For example: // Requires `org.mozilla.components:concept-fetch`
