In order to make the custom Application class handle uncaught exceptions, extend the class definition by adding Thread.UncaughtExceptionHandler as an inherited class like this: class MainActivity : AppCompatActivity(), Thread.UncaughtExceptionHandler { ...
} As part of implementing the Thread.UncaughtExceptionHandler interface, the custom Application needs to implement the override of the uncaughtException() function. An example of this override that records data and sends the ping could look something like this: override fun uncaughtException(thread: Thread, exception: Throwable) { Crash.exception.record( mapOf( Crash.exceptionKeys.cause to exception.cause!!.toString(), Crash.exceptionKeys.message to exception.message!! ) ) Pings.crash.submit()
} This records data to the Crash.exception metric from the metrics.yaml. The category of the metric is crash and the name is exception so it is accessed it by calling record() on the Crash.exception object. The extra information for the cause and the message is set as well. Finally, calling Pings.crash.submit() forces the crash ping to be scheduled to be sent. The final step is to register the custom Application as the default uncaught exception handler by adding the following to the onCreate() function after Glean.initialize(this): Thread.setDefaultUncaughtExceptionHandler(this)

