Using the Glean SDK's unit testing API requires adding Robolectric 4.0 or later as a testing dependency. In Gradle, this can be done by declaring a testImplementation dependency: dependencies { testImplementation "org.robolectric:robolectric:4.3.1" } In order to prevent issues with async calls when unit testing the Glean SDK, it is important to put the Glean SDK into testing mode by applying the JUnit GleanTestRule to your test class. When the Glean SDK is in testing mode, it enables uploading and clears the recorded metrics at the beginning of each test run. The rule can be used as shown below: @RunWith(AndroidJUnit4::class)
class ActivityCollectingDataTest { // Apply the GleanTestRule to set up a disposable Glean instance. // Please note that this clears the Glean data across tests. @get:Rule val gleanRule = GleanTestRule(ApplicationProvider.getApplicationContext()) @Test fun checkCollectedData() { // The Glean SDK testing API can be called here. }
} This will ensure that metrics are done recording when the other test functions are used. To check if a value exists (i.e. it has been recorded), there is a testHasValue() function on each of the metric instances: assertTrue(GleanMetrics.Search.defaultSearchEngineUrl.testHasValue()) To check the actual values, there is a testGetValue() function on each of the metric instances. It is important to check that the values are recorded as expected, since many of the metric types may truncate or error-correct the value. This function will return a datatype appropriate to the specific type of the metric it is being used with: assertEquals("https://example.com/search?", GleanMetrics.Search.defaultSearchEngineUrl.testGetValue()) Note that each of these functions has its visibility limited to the scope of unit tests by making use of the @VisibleForTesting annotation, so the IDE should complain if you attempt to use them inside of client code. NOTE : There's no automatic test rule for Glean tests implemented. In order to prevent issues with async calls when unit testing the Glean SDK, it is important to put the Glean SDK into testing mode. When the Glean SDK is in testing mode, it enables uploading and clears the recorded metrics at the beginning of each test run. Activate it by resetting Glean in your test's setup: @testable import Glean
import XCTest class GleanUsageTests: XCTestCase { override func setUp() { Glean.shared.resetGlean(clearStores: true) } // ...
} This will ensure that metrics are done recording when the other test functions are used. To check if a value exists (i.e. it has been recorded), there is a testHasValue() function on each of the metric instances: XCTAssertTrue(GleanMetrics.Search.defaultSearchEngineUrl.testHasValue()) To check the actual values, there is a testGetValue() function on each of the metric instances. It is important to check that the values are recorded as expected, since many of the metric types may truncate or error-correct the value. This function will return a datatype appropriate to the specific type of the metric it is being used with: XCTAssertEqual("https://example.com/search?", try GleanMetrics.Search.defaultSearchEngineUrl.testGetValue()) Note that each of these functions is marked as internal, you need to import Glean explicitly in test mode: @testable import Glean It is generally a good practice to "reset" the Glean SDK prior to every unit test that uses the Glean SDK, to prevent side effects of one unit test impacting others. The Glean SDK contains a helper function glean.testing.reset_glean() for this purpose. It has two required arguments: the application ID, and the application version. Each reset of the Glean SDK will create a new temporary directory for Glean to store its data in. This temporary directory is automatically cleaned up the next time the Glean SDK is reset or when the testing framework finishes. The instructions below assume you are using pytest as the test runner. Other test-running libraries have similar features, but are different in the details. Create a file conftest.py at the root of your test directory, and add the following to reset Glean at the start of every test in your suite: import pytest
